  let myLIsts=[
    {      title:'Afternoon jogg',      desc:'whatever man'    },

    {      title:'Morning Jog',      desc:'whatever man'    },

    {      title:'Evening Sesh',      desc:'whatever man'    },

  ]



    return(
      <div className="Content">
      <div className="list">
      <div className="title">{title}</div>
      <div className="desc">{desc}</div>
      </div>
      </div>
  );
}
export default Content;
